import React, {Component} from 'react';

class PokemonCard extends Component {

    state = {
        name: '',
        imageUrl: '',
        pokemonIndex: ''
    };

    render() {
        const { url, name } = this.props;
        return (
            <div className='col-md-3 col-sm-6 mb-5'>
                <div className={'card'}>
                    <div className="card-header">{name}</div>
                </div>
            </div>
        );
    }
}

export default PokemonCard;
